import React from 'react';
import { BrowserRouter } from 'react-router-dom'

class App extends React.Component {
  render() {
    return(
      <BrowserRouter>
      <div className="App">
        <h1>Virtual Host</h1>
      </div>
      </BrowserRouter>
    );
  }
}

export default App;
